import React, { useState } from 'react'
import Logo from './img/logo.svg'
import Styles from './Nav.module.css'
import { useNavigate } from 'react-router-dom'

const Nav = () => {
  const [index, setIndex] = useState(0)
  const navigate = useNavigate()

  return (
    <div className={Styles['nav-container']}>
      <img
        src={Logo}
        alt='logo'
        onClick={() => navigate('/')}
        className={Styles.logo}
      />
      <div className={Styles['nav-decoration']} />
      <div>
        <ul className={Styles['nav-ul']}>
          <NavComponent number='00' name='Home' click={() => navigate('/')} />
          <NavComponent
            number='01'
            name='Destination'
            click={() => navigate('/destination')}
          />
          <NavComponent
            number='02'
            name='Crew'
            click={() => navigate('/crew')}
          />
          <NavComponent
            number='03'
            name='Technology'
            click={() => navigate('/technology')}
          />
        </ul>
      </div>
    </div>
  )
}

const NavComponent = (props) => {
  return (
    <li className={Styles['navComponent-list']} onClick={props.click}>
      <span className={Styles['navComponent-list-number']}>{props.number}</span>
      <span className={Styles['navComponent-list-name']}> {props.name}</span>
    </li>
  )
}

export default Nav
